import React from 'react';
import 'bootstrap/dist/css/bootstrap.min.css';
import icon from '../../../img/icon.png'
import { Container, Row, Col, Nav, Button, Navbar, Form, FormControl, Carousel} from 'react-bootstrap';
import Posts from './post/post'
import { OnPostchangecreator, addPostcreator } from '../../../redux/state/PostsData-reducer';

const Postscontainer = (props) => {
    let state = props.store.getState().DialogsData;
    let addPost = () =>{
        props.store.dispatch(addPostcreator());
    }
    let OnPostchange = (text) =>{
        props.store.dispatch(OnPostchangecreator(text));
    } 
    return (
        <Posts addPost={addPost} OnPostchange={OnPostchange} PostsData={props.state}/>
    );
}
export default Postscontainer;
